import React, { Component } from 'react';

function Header() {
  return (
    <header style = {headerStyle}>
      <h1> ToDo List </h1>
    </header>
  );
};

const headerStyle = {
  textAlign: 'center',
  padding: '10px',
  background: 'black',
  color: 'white'
}

export default Header;
